import React from 'react';

function Header() {
    const title = "Design is my life";
    const client = "Designer";

    if (client === "Designer") {
        title = "Design is my life";
    } else {
        title = "Programing is my life"
    }

    return (
        <div className='shadow-sm bg-dark p-3 text-white rounded'>
            <h1>{title}</h1>
        </div>
    );
};

export default Header;
